import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Signup from "D:\hridamrit\backend\react-frontend\src\pages\Predict.js";
import Predict from "D:\hridamrit\backend\react-frontend\src\pages\Predict.js";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Signup />} />
        <Route path="/predict" element={<Predict />} />
      </Routes>
    </Router>
  );
}

export default App;
